import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './Home'
import Test from './Test'

function App() {
  return (
    <div className="bg-emerald-500 bg-contain w-screen h-screen flex flex-column justify-center">
      <Router>
        <Routes>
          <Route exact path="/" element={
            <Home />
          }/>
          <Route path="/signup" element={
            <Signup />
          }/>
        </Routes>
      </Router>
      <Test />
    </div>
  );
}

export default App;
